"She is  Pixie the puppy. She was found on the street with her siblings, bellies full of worms and still with her mum. The puppies were taken to the sanctuary of puerto Morelos @puertomoreloscause4paws at around 8 weeks old.
They were all treated and luckily all regimes. We got pixie at around 10 weeks old. After having her a few days we discovered she was deaf but that has not held back her personality. 

We also have Mocha. Mocha was a street dog with pups when she was around 1 year and she and the pups were rescued after being thrown out and taken to Puerto Morelos Cause4Paws. She was there for 6 years until we moved here and fell in love with her straight away. She has had no problem in settling in with us and is a perfect guard dog and family dog. She is a perfect example for pixie to follow üòä" 

